INSERT INTO `v1_0458776a712978f5a8f39203fe260ec2070eeec75525b1baf70070361ed9eaf8` VALUES (2, "人助け、応援", "こんにちは！　ヒヨリでっす！\n困っている人がいたら助けにいくよ！\nよかったら一緒に来ない？", 27, 8, 0, "トゥインクルウィッシュ", 155, 16, "人助けが大好き！　前向き格闘娘", 44, "獣人族", 100101, "A", "東山奈央", "ヒヨリ");
INSERT INTO `v1_0458776a712978f5a8f39203fe260ec2070eeec75525b1baf70070361ed9eaf8` VALUES (2, "料理、人間観察", "あんまり役に立てるかはわからないけど…\nわたしも頑張って、\nみんなをサポートするね！", 5, 4, 0, "トゥインクルウィッシュ", 158, 17, "戦闘のサポートが得意な、心優しい少女", 47, "ヒューマン", 100201, "O", "種田梨沙", "ユイ");
INSERT INTO `v1_0458776a712978f5a8f39203fe260ec2070eeec75525b1baf70070361ed9eaf8` VALUES (2, "読書、乗馬、お茶", "キミと会ったのもきっと何かの縁だ\n一緒に塔の頂上を目指す仲間として\n頑張っていこう。よろしく頼む", 12, 1, 0, "トゥインクルウィッシュ", 163, 18, "クールで何事にも真っ直ぐな剣士", 46, "魔族", 100301, "B", "早見沙織", "レイ");
INSERT INTO `v1_0458776a712978f5a8f39203fe260ec2070eeec75525b1baf70070361ed9eaf8` VALUES (5, "いたずら、探検", "イタズラなら任せて！\nにいちゃん、引っかからないように気を付けなよー♪", 10, 8, 0, "リトルリリカル", 128, 9, "探検好きのイタズラっ子", 27, "ヒューマン", 100401, "O", "諸星すみれ", "ミソギ");
