INSERT INTO `v1_0458776a712978f5a8f39203fe260ec2070eeec75525b1baf70070361ed9eaf8` VALUES (7, "サックス", "アカリ、まだわからないことが多くて…\nだからこれから\nいろいろ教えてくださいね、お兄ちゃん！", 22, 11, 0, "悪魔偽王国軍（ディアボロス）", 150, 13, "甘え上手なみんなの人気者", 42, "魔族", 100601, "O", "浅倉杏美", "アカリ");
INSERT INTO `v1_0458776a712978f5a8f39203fe260ec2070eeec75525b1baf70070361ed9eaf8` VALUES (7, "プリンを食べること", "難しいことはわからないの～\nただ毎日プリンを食べられるなら、\n幽霊のままでいいの～", 23, 1, 0, "悪魔偽王国軍（ディアボロス）", 130, 14, "プリン大好きゴースト娘", 32, "魔族", 100701, "B", "雨宮天", "ミヤコ");
INSERT INTO `v1_0458776a712978f5a8f39203fe260ec2070eeec75525b1baf70070361ed9eaf8` VALUES (15, "鏡で自分を見ること", "ボクって本当に美しいなあ…\n可愛くて美しいなんて本当に罪だと思うけど\n生まれもったものだから仕方ないんだ♪", 10, 10, 0, "ヴァイスフリューゲル　ランドソル支部", 150, 14, "ボクは誰よりも美しい", 40, "エルフ", 100801, "AB", "大空直美", "ユキ");
INSERT INTO `v1_0458776a712978f5a8f39203fe260ec2070eeec75525b1baf70070361ed9eaf8` VALUES (13, "小説執筆", "いいか、絶対に私を真名で呼ぶなよ？\n常に「機関」の眼や耳の存在を疑え\nそれが、生きのびるための術だ…！", 5, 7, 0, "トワイライトキャラバン", 159, 17, "前世を信じる中二病患者、「疾風の冥姫」", 45, "魔族", 100901, "A", "髙野麻美", "アンナ");
INSERT INTO `v1_0458776a712978f5a8f39203fe260ec2070eeec75525b1baf70070361ed9eaf8` VALUES (10, "空想、ぬいぐるみ集め", "マホマホ王国のお姫はんの、マホ姫どす！\nけったいな顔してどないしはったん？\nマホマホ王国はずーっと遠くの国なんどす？", 22, 9, 0, "自警団（カォン）", 155, 16, "マホマホ王国のプリンセス", 42, "獣人族", 101001, "O", "内田真礼", "マホ");
INSERT INTO `v1_0458776a712978f5a8f39203fe260ec2070eeec75525b1baf70070361ed9eaf8` VALUES (3, "お裁縫", "覚えていないと思うんですけど…\n私は妹なんですよ！\nだからお兄ちゃんって呼んでいいですか？", 25, 8, 0, "ラビリンス", 156, 15, "人懐っこくてマシンガントークな妹系少女", 44, "ヒューマン", 101101, "A", "阿澄佳奈", "リノ");
INSERT INTO `v1_0458776a712978f5a8f39203fe260ec2070eeec75525b1baf70070361ed9eaf8` VALUES (6, "妹と遊ぶこと、二度寝、昼寝、早寝", "私はハツネ！　困っている人の味方だよ！\n困った時は、いつでも言ってね♪\n私のちょ…ま、魔法で助けてあげるから！", 24, 12, 0, "フォレスティエ", 156, 17, "みんなのために超能力を使う眠り姫", 46, "エルフ", 101201, "A", "大橋彩香", "ハツネ");
