INSERT INTO `v1_0458776a712978f5a8f39203fe260ec2070eeec75525b1baf70070361ed9eaf8` VALUES (14, "ファッション", "ヒデサイ、ちょっす～！　うち、漢字と計算は\nちょっち…てか、おに苦手なんだ～\nでもでも、ファッションだったら任せて～！", 10, 4, 0, "ルーセント学院", 167, 18, "天真爛漫で人気者のカリスマモデル", 48, "魔族", 101601, "O", "上坂すみれ", "スズナ");
INSERT INTO `v1_0458776a712978f5a8f39203fe260ec2070eeec75525b1baf70070361ed9eaf8` VALUES (10, "踊り、空手", "ハイターイ！　歌って踊って、\n最高に盛り上がるさ～！\nやさやさ、キミも一緒に踊るさ～！", 7, 7, 0, "自警団（カォン）", 158, 19, "いつでも「なんくるないさ～」な天然娘", 53, "獣人族", 101701, "A", "高森奈津美", "カオリ");
INSERT INTO `v1_0458776a712978f5a8f39203fe260ec2070eeec75525b1baf70070361ed9eaf8` VALUES (14, "恋愛小説、恋愛舞台、恋愛漫画の鑑賞", "いつも助けてくれてありがとう\n私のほうが年上なのに\n頼ってばかりでごめんなさい～", 14, 8, 0, "ルーセント学院", 162, 23, "多くの男性を魅了する無垢な女教師", 52, "魔族", 101801, "B", "伊藤静", "イオ");
INSERT INTO `v1_0458776a712978f5a8f39203fe260ec2070eeec75525b1baf70070361ed9eaf8` VALUES (5, "かわいいもの集め", "ぴょんぴょん、うさぎさんになりたいな～♪　\nミミ、うさぎさんになれたら、\n最初におにいちゃんに見せてあげるね！", 3, 4, 0, "リトルリリカル", 117, 10, "お歌もにんじんも、ウサギさんも大好き♪", 21, "獣人族", 102001, "O", "日高里菜", "ミミ");
INSERT INTO `v1_0458776a712978f5a8f39203fe260ec2070eeec75525b1baf70070361ed9eaf8` VALUES (9, "観劇、おままごと", "あの、えっと…私、く、クルミですぅ…\nふ、ふぇぇぇ…ど、どうしようぅ…\nは、恥かしくて…ご、ごめんなさいぃぃ！", 9, 6, 0, "サレンディア救護院", 150, 12, "泣き虫で臆病な守ってあげたい女の子", 40, "ヒューマン", 102101, "B", "植田佳奈", "クルミ");
INSERT INTO `v1_0458776a712978f5a8f39203fe260ec2070eeec75525b1baf70070361ed9eaf8` VALUES (7, "ゲーム全般", "え、えっと…こ、こういうときって、\nどういうことを言えばいいんだっけ…\nうう、どうしてちゃんと喋れないの…", 22, 11, 0, "悪魔偽王国軍（ディアボロス）", 150, 13, "人見知りであまのじゃくな女の子", 40, "魔族", 102201, "O", "原紗友里", "ヨリ");
INSERT INTO `v1_0458776a712978f5a8f39203fe260ec2070eeec75525b1baf70070361ed9eaf8` VALUES (9, "屋内でできる遊び", "この子はね、ぷうきちって言うんだ\n武器なんだけど、しゃべるんだよ♪\n大事な大事な、私の友達なんだぁ～！", 10, 5, 0, "サレンディア救護院", 148, 14, "ぷうきちといつも一緒！", 38, "ヒューマン", 102301, "B", "芹澤優", "アヤネ");
INSERT INTO `v1_0458776a712978f5a8f39203fe260ec2070eeec75525b1baf70070361ed9eaf8` VALUES (9, "ご奉仕", "うぅ…ごめんなさい～…\nまたキッチンを爆発させてしまいました～\nこれじゃあメイド失格です…", 12, 12, 0, "サレンディア救護院", 154, 15, "お嬢さまのためにがんばるドジっ娘メイド", 43, "ヒューマン", 102501, "O", "悠木碧", "スズメ");
