INSERT INTO `v1_0458776a712978f5a8f39203fe260ec2070eeec75525b1baf70070361ed9eaf8` VALUES (13, "実験、裁縫、料理", "『壊し屋』の二つ名を持つ私…\nですが、怖がる必要はありませんわ\nあなた様は大切な運命の人ですから…", 30, 7, 0, "トワイライトキャラバン", 154, 16, "運命の相手に一途すぎる乙女", 43, "魔族", 102701, "B", "橋本ちなみ", "エリコ");
INSERT INTO `v1_0458776a712978f5a8f39203fe260ec2070eeec75525b1baf70070361ed9eaf8` VALUES (9, "経営、お茶会", "貧乏性？　いいえ、\n「もったいない」の精神で\n日々を過ごしてるだけよ！", 4, 10, 0, "サレンディア救護院", 156, 17, "救護院を経営する優しい庶民派お嬢様", 43, "エルフ", 102801, "A", "堀江由衣", "サレン");
