INSERT INTO `v1_0458776a712978f5a8f39203fe260ec2070eeec75525b1baf70070361ed9eaf8` VALUES (7, "占い", "私、小さい頃から人には見えないものが\n見えていたんです。今もあなたの後ろに\n一人、二人、三人…賑やかですね", 22, 12, 0, "悪魔偽王国軍（ディアボロス）", 157, 18, "占いが得意な霊能少女", 42, "魔族", 103101, "AB", "大坪由佳", "シノブ");
