INSERT INTO `v1_0458776a712978f5a8f39203fe260ec2070eeec75525b1baf70070361ed9eaf8` VALUES (11, "漫才", "オラはどんな時でもみんなに笑顔を届ける\n最高の芸人目指してる！\n一緒に頑張るべ！", 3, 3, 0, "牧場（エリザベスパーク）", 142, 20, "みんなを笑顔にするお笑い牧場主", 35, "ヒューマン", 103301, "B", "新田恵海", "マヒル");
