INSERT INTO `v1_0458776a712978f5a8f39203fe260ec2070eeec75525b1baf70070361ed9eaf8` VALUES (11, "読書、お散歩", "ゴホッ、ゴホッ…か、身体は弱いけど、\nせめて気持ちだけでも前向きに…！\nあっ、でもダメ…立ちくらみが…", 3, 11, 0, "牧場（エリザベスパーク）", 153, 14, "読書が趣味の病弱少女", 40, "獣人族", 103801, "A", "小清水亜美", "シオリ");
