INSERT INTO `v1_0458776a712978f5a8f39203fe260ec2070eeec75525b1baf70070361ed9eaf8` VALUES (4, "各種楽器", "私は人々の平和を守るため、唱喚術を使って\n戦います。…最近は、ア、アイドルとしても\n活動してますが、そちらはまだ不慣れで…", 3, 6, 0, "カルミナ", 163, 17, "人々を守るために歌う、唱喚士の少女", 46, "ヒューマン", 104201, "O", "福原綾香", "チカ");
INSERT INTO `v1_0458776a712978f5a8f39203fe260ec2070eeec75525b1baf70070361ed9eaf8` VALUES (10, "お菓子作り", "腹へってたら言えよな\n簡単でよければ\nすっげー旨いもん食わせてやるよ！", 9, 8, 0, "自警団（カォン）", 168, 17, "男勝りで情に厚いワイルド娘", 54, "獣人族", 104301, "O", "小松未可子", "マコト");
