INSERT INTO `v1_0458776a712978f5a8f39203fe260ec2070eeec75525b1baf70070361ed9eaf8` VALUES (15, "小説を読むこと", "あなたのことを考えていました\n…逆らえないクウカをああして、こうして\nぐふ、ぐふふふ…", 19, 11, 0, "ヴァイスフリューゲル　ランドソル支部", 157, 18, "妄想大好き！　ほんとは照れ屋な女の子", 49, "ヒューマン", 104501, "AB", "長妻樹里", "クウカ");
