INSERT INTO `v1_0458776a712978f5a8f39203fe260ec2070eeec75525b1baf70070361ed9eaf8` VALUES (12, "猫とたわむれること", "お金もうけの話なら、ぜひともあたしに\n持ってくるにゃ！　稼げるなら１ルピだって\n見逃さないのが、あたしの信条にゃ～♪", 1, 3, 0, "メルクリウス財団", 158, 18, "弱きを助け強きをくじく猫娘", 48, "獣人族", 107901, "AB", "沼倉愛美", "タマキ（サマー）");
INSERT INTO `v1_0458776a712978f5a8f39203fe260ec2070eeec75525b1baf70070361ed9eaf8` VALUES (12, "傭兵などのアルバイト", "私がキミの師匠になってあげる！\nもちろんタダとはいかないわ\n時給はしっかりもらうから", 11, 11, 0, "メルクリウス財団", 163, 20, "仕事も私事も効率優先な傭兵少女", 49, "ヒューマン", 108001, "O", "田所あずさ", "ミフユ（サマー）");
INSERT INTO `v1_0458776a712978f5a8f39203fe260ec2070eeec75525b1baf70070361ed9eaf8` VALUES (7, "占い", "私、小さい頃から人には見えないものが\n見えていたんです。今もあなたの後ろに\n一人、二人、三人…賑やかですね", 22, 12, 0, "悪魔偽王国軍（ディアボロス）", 157, 18, "占いが得意な霊能少女", 42, "魔族", 108101, "AB", "大坪由佳", "シノブ（ハロウィン）");
INSERT INTO `v1_0458776a712978f5a8f39203fe260ec2070eeec75525b1baf70070361ed9eaf8` VALUES (7, "プリンを食べること", "難しいことはわからないの～\nただ毎日プリンを食べられるなら、\n幽霊のままでいいの～", 23, 1, 0, "悪魔偽王国軍（ディアボロス）", 130, 14, "プリン大好きゴースト娘", 32, "魔族", 108201, "B", "雨宮天", "ミヤコ（ハロウィン）");
