INSERT INTO `v1_0458776a712978f5a8f39203fe260ec2070eeec75525b1baf70070361ed9eaf8` VALUES (4, "各種楽器", "私は人々の平和を守るため、唱喚術を使って\n戦います。…最近は、ア、アイドルとしても\n活動してますが、そちらはまだ不慣れで…", 3, 6, 0, "カルミナ", 163, 17, "人々を守るために歌う、唱喚士の少女", 46, "ヒューマン", 108401, "O", "福原綾香", "チカ（クリスマス）");
INSERT INTO `v1_0458776a712978f5a8f39203fe260ec2070eeec75525b1baf70070361ed9eaf8` VALUES (9, "観劇、おままごと", "あの、えっと…私、く、クルミですぅ…\nふ、ふぇぇぇ…ど、どうしようぅ…\nは、恥かしくて…ご、ごめんなさいぃぃ！", 9, 6, 0, "サレンディア救護院", 150, 12, "泣き虫で臆病な守ってあげたい女の子", 40, "ヒューマン", 108501, "B", "植田佳奈", "クルミ（クリスマス）");
INSERT INTO `v1_0458776a712978f5a8f39203fe260ec2070eeec75525b1baf70070361ed9eaf8` VALUES (9, "屋内でできる遊び", "この子はね、ぷうきちって言うんだ\n武器なんだけど、しゃべるんだよ♪\n大事な大事な、私の友達なんだぁ～！", 10, 5, 0, "サレンディア救護院", 148, 14, "ぷうきちといつも一緒！", 38, "ヒューマン", 108601, "B", "芹澤優", "アヤネ（クリスマス）");
INSERT INTO `v1_0458776a712978f5a8f39203fe260ec2070eeec75525b1baf70070361ed9eaf8` VALUES (2, "人助け、応援", "こんにちは！　ヒヨリでっす！\n困っている人がいたら助けにいくよ！\nよかったら一緒に来ない？", 27, 8, 0, "トゥインクルウィッシュ", 155, 16, "人助けが大好き！　前向き格闘娘", 44, "獣人族", 108701, "A", "東山奈央", "ヒヨリ（ニューイヤー）");
INSERT INTO `v1_0458776a712978f5a8f39203fe260ec2070eeec75525b1baf70070361ed9eaf8` VALUES (2, "料理、人間観察", "あんまり役に立てるかはわからないけど…\nわたしも頑張って、\nみんなをサポートするね！", 5, 4, 0, "トゥインクルウィッシュ", 158, 17, "戦闘のサポートが得意な、心優しい少女", 47, "ヒューマン", 108801, "O", "種田梨沙", "ユイ（ニューイヤー）");
INSERT INTO `v1_0458776a712978f5a8f39203fe260ec2070eeec75525b1baf70070361ed9eaf8` VALUES (2, "読書、乗馬、お茶", "キミと会ったのもきっと何かの縁だ\n一緒に塔の頂上を目指す仲間として\n頑張っていこう。よろしく頼む", 12, 1, 0, "トゥインクルウィッシュ", 163, 18, "クールで何事にも真っ直ぐな剣士", 46, "魔族", 108901, "B", "早見沙織", "レイ（ニューイヤー）");
